function change(obj){
	var divs=document.getElementsByClassName('btn');
	for(var i=0;i<divs.length;i++){
		divs[i].style.setProperty('background-color','white');
		divs[i].style.setProperty('color','black');
		divs[i].style.setProperty('border','2px solid black');
	}
	obj.style.setProperty('background-color','#3498db');
	obj.style.setProperty('color','white');
	obj.style.setProperty('border','2px solid #3498db');
	var txt=obj.innerHTML;
	
	var dataArray=allData[txt];
	
	var xData=[];
	var yData=[];
	var yData2=[];
	var data=dataArray[0].data.curve;
	var data2=dataArray[1].data.curve;
	for (var i=0;i<data.length;i++){
		yData.push(data[i].congest_length);
		yData2.push(data2[i].congest_length);
		var datetime= new Date(data[i].datatime*1000);
		var dataStr=datetime.getMonth()+1+"-"+datetime.getDate()+" "+datetime.getHours()+":"+(datetime.getMinutes()?"30":"00");
		xData.push(dataStr);
	}
	

	var line = [{xAxis: dataArray[3]},{xAxis: dataArray[4]}];
	
	var option = {
	    title: {text: txt+"（"+dataArray[2]+"）"+'拥堵统计'},
		xAxis : [{ data: xData,}],
	    series : [ {data:yData,markLine:{data:line}}, {data: yData2}]
	}
	myChart.setOption(option);
	
	
}
